import React from "react";
import Choice from "./maneComponents/小hoice";
import Advertising from "./maneComponents/Advertising";
import Catalog from "./maneComponents/小atalog";
function Main() {
  return (
    <>
      <Choice />
      <Advertising />
      <div className="container">
        <Catalog />
        <SwiperActual/>
      </div>
    </>
  );
}

export default Main;
